#include<vector>

using namespace std;

/*
你和一群强盗准备打劫银行。给你一个下标从 0 开始的整数数组 security ，
其中 security[i] 是第 i 天执勤警卫的数量。日子从 0 开始编号。同时给你一个整数 time 。

如果第 i 天满足以下所有条件，我们称它为一个适合打劫银行的日子：

第 i 天前和后都分别至少有 time 天。
第 i 天前连续 time 天警卫数目都是非递增的。
第 i 天后连续 time 天警卫数目都是非递减的。
更正式的，第 i 天是一个合适打劫银行的日子当且仅当：security[i - time] >= security[i - time + 1] >= ... >= security[i] <= ... <= security[i + time - 1] <= security[i + time].

请你返回一个数组，包含 所有 适合打劫银行的日子（下标从 0 开始）。返回的日子可以 任意 顺序排列。

输入：security = [5,3,3,3,5,6,2], time = 2
输出：[2,3]
解释：
第 2 天，我们有 security[0] >= security[1] >= security[2] <= security[3] <= security[4] 。
第 3 天，我们有 security[1] >= security[2] >= security[3] <= security[4] <= security[5] 。
没有其他日子符合这个条件，所以日子 2 和 3 是适合打劫银行的日子。
*/

class Solution {
public:
    vector<int> goodDaysToRobBank(vector<int>& security, int time) {    // 暴力 解法  有的超时
        vector<int> res;                                                // 但是 结果没有问题
        int N = security.size() ;
        if(time == 0){
            for(int i = 0;i<=N;i++){
                res.push_back(i);
            }
            return res;
        }
        if(N % 2 == 0){
            if(time >= N / 2) return res;
        }else{
            if(time > N / 2) return res;
        }
        
        for(int i = time;i<N-time;i++){
            int left = i-time,mid = i,right = i + time;
            while(left<mid){
                if(security[left] >= security[left + 1]){
                    left++;
                    continue;
                }
                else break;
            }
            while(right>mid){
                if(security[right] >= security[right-1]){
                    right--;
                    continue;
                }
                else break;
            }
            
            if(left == mid && right == mid)
                res.push_back(mid);

            
        }
        return res;
    }
};
/*

题目中第 ii 天适合打劫需满足：
第 i 天前连续 time 天警卫数目都是非递增与第 ii天后连续 time 天警卫数目都是非递减。
只需要预先计算出第 i天前警卫数目连续非递增的天数以及
第 i 天后警卫数目连续非递减的天数即可判断第 i天是否适合打劫。

*/
class Solution2 {
public:
    vector<int> goodDaysToRobBank(vector<int>& security, int time) {
        int n = security.size();
        vector<int> left(n);
        vector<int> right(n);
        for (int i = 1; i < n; i++) {
            if (security[i] <= security[i - 1]) {
                left[i] = left[i - 1] + 1;
            }
            if (security[n - i - 1] <= security[n - i]) {
                right[n - i - 1] = right[n - i] + 1;
            }
        }

        vector<int> ans;
        for (int i = time; i < n - time; i++) {
            if (left[i] >= time && right[i] >= time) {
                ans.emplace_back(i);
            }
        }
        return ans;
    }
};


